@app.route("/")
def default():
    return redirect(url_for("home"))

@app.route("/home", methods=["GET", "POST"])
def home():
    result = ""
    vertices = walmart_neighborhood.V
    source_name = walmart_header[0]
    all_paths = walmart_neighborhood.findShortestPath(0)
    total_distance = None

    if request.method == "POST":
        input_choice_from = int(request.form["input-from"])
        input_choice_to = int(request.form["input-to"])

        if (input_choice_from == "") or (input_choice_to == ""):
            result = Markup("<span style=\"color:red;\">Please input all entries.</span>")
        elif (int(input_choice_from) > len(walmart_map)) or (int(input_choice_from) <= 0):
            result = Markup("<span style=\"color:red;\"><b>Source input is invalid.</b><br/>Please pick a choice from 1 to ") + str(len(walmart_map)) + Markup("</span>")
        elif (int(input_choice_to) > len(walmart_map)) or (int(input_choice_to) <= 0):
            result = Markup("<span style=\"color:red;\"><b>Destination input is invalid.</b><br/>Please pick a choice from 1 to ") + str(len(walmart_map)) + Markup("</span>")
        else:
            if int(input_choice_from) == int(input_choice_to):
                result =  Markup("<span style=\"color:red;\">You are going to where you already are!</span>")
                source_name = str(walmart_header[int(input_choice_from)-1])
                all_paths = walmart_neighborhood.findShortestPath(int(input_choice_from)-1)
                return render_template("walmart_neighborhood.html", all_paths=all_paths, input_choice_from=input_choice_from, input_choice_to=input_choice_to, vertices=vertices, list=walmart_locations, path=result, header=walmart_header, source_name=source_name, total_distance=total_distance)
            
            total_distance = float(walmart_neighborhood.getTotalCost(int(input_choice_from)-1, int(input_choice_to)-1))
            print("THIS:", total_distance)
            result = walmart_neighborhood.printShortestPath(int(input_choice_from)-1, int(input_choice_to)-1)
            source_name = str(walmart_header[int(input_choice_from)-1])
            all_paths = walmart_neighborhood.findShortestPath(int(input_choice_from)-1)

        return render_template("walmart_neighborhood.html", all_paths=all_paths, input_choice_from=input_choice_from, input_choice_to=input_choice_to, vertices=vertices, list=walmart_locations, path=result, header=walmart_header, source_name=source_name, total_distance=total_distance)

    else:
        return render_template("walmart_neighborhood.html", all_paths=all_paths, input_choice_from=0, vertices=vertices, list=walmart_locations, path=result, header=walmart_header)

if __name__ == "__main__":
    app.run(debug = True)

